import React from 'react'
import Api from '../api/api'
import Card from '../Card/cards'


const Process = props => (
  <div>
    {Api.map(({ img, name, desc }) => (
      <>
        <Card img={img} 
        name={name} 
        desc={desc} />
      </>
    ))}
    }
  </div>
);

export default Process;
